import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { Clock, Award, Users, ArrowRight, BookOpen } from "lucide-react";
import api from "../utils/api";
import "./MyTests.css";

export default function MyTests() {
  const [tests, setTests] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchTests = async () => {
      try {
        console.log("Fetching tests...");
        const { data } = await api.get("/student/tests");
        console.log("Response data:", data);
        setTests(data);
      } catch (err) {
        console.error("Failed to fetch tests:", err);
        console.error("Error details:", err.response?.data);
      } finally {
        setLoading(false);
      }
    };
    fetchTests();
  }, []);

  const startTest = (test) => {
    navigate(`/test-instructions/${test._id}`, { state: { test } });
  };

  const getCardColor = (index) => {
    const colors = [
      "from-blue-500 to-blue-600",
      "from-purple-500 to-purple-600", 
      "from-emerald-500 to-emerald-600",
      "from-orange-500 to-orange-600",
      "from-pink-500 to-pink-600",
      "from-indigo-500 to-indigo-600"
    ];
    return colors[index % colors.length];
  };

  const getBgColor = (index) => {
    const colors = [
      "bg-blue-50",
      "bg-purple-50",
      "bg-emerald-50", 
      "bg-orange-50",
      "bg-pink-50",
      "bg-indigo-50"
    ];
    return colors[index % colors.length];
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto mb-4"></div>
          <p className="text-gray-600">Loading tests...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="tests-container">
      <div className="tests-header">
        <div className="header-content">
          <div className="header-icon">
            <BookOpen className="w-8 h-8 text-blue-600" />
          </div>
          <div>
            <h1 className="page-title">Available Tests</h1>
            <p className="page-subtitle">Choose a test to begin your assessment</p>
          </div>
        </div>
      </div>

      <div className="tests-content">
        {tests.length === 0 ? (
          <div className="no-tests">
            <div className="no-tests-icon">
              <FileText className="w-16 h-16 text-gray-400" />
            </div>
            <h3 className="no-tests-title">No Tests Available</h3>
            <p className="no-tests-description">
              There are currently no tests available. Please check back later.
            </p>
          </div>
        ) : (
          <div className="tests-grid">
            {tests.map((test, index) => (
              <div
                key={test._id}
                className={`test-card ${getBgColor(index)}`}
              >
                <div className="test-card-header">
                  <div className={`test-icon bg-gradient-to-r ${getCardColor(index)}`}>
                    <BookOpen className="w-6 h-6 text-white" />
                  </div>
                  <h2 className="test-name">{test.name}</h2>
                </div>

                <div className="test-details">
                  <div className="test-detail-item">
                    <Award className="w-4 h-4 text-gray-500" />
                    <span className="test-detail-label">Max Marks:</span>
                    <span className="test-detail-value">{test.totalMarks}</span>
                  </div>
                  
                  <div className="test-detail-item">
                    <Clock className="w-4 h-4 text-gray-500" />
                    <span className="test-detail-label">Duration:</span>
                    <span className="test-detail-value">{test.duration} min</span>
                  </div>

                  <div className="test-detail-item">
                    <Users className="w-4 h-4 text-gray-500" />
                    <span className="test-detail-label">Questions:</span>
                    <span className="test-detail-value">{test.questions?.length || 0}</span>
                  </div>
                </div>

                <button
                  className={`take-test-btn bg-gradient-to-r ${getCardColor(index)}`}
                  onClick={() => startTest(test)}
                >
                  <span>Start Test</span>
                  <ArrowRight className="w-4 h-4" />
                </button>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}
